import React, { useState } from "react";
import "./App.css";
import { EntityType } from "./types/entity-type";
import { EntityToggle } from "./components/entity-toggle";
import { OrderBook } from "./components/order-book";
import { OrderForm } from "./components/order-form";

const App = () => {
  const [entity, setEntity] = useState<EntityType>("BTC");

  const toggleEntityValue = (entity: EntityType) => {
    setEntity(entity);
  };

  return (
    <div className="flexjustify-center items-center bg-zinc-800 h-screen">
      <div className="h-3/5 w-3/5 rounded-lg shadow-lg bg-gray-300 flex flex-col justify-start items-center gap-10">
        <EntityToggle entity={entity} toggleEntityValue={toggleEntityValue} />
        <div className="flex gap-10">
          <OrderBook entity={entity} />
          <OrderForm entity={entity} />
        </div>
      </div>
    </div>
  );
};

export default App;
